    <div className='Navbar'>
      <div className='Navbar-body'>
      <img src='images/logo.png'alt=''/>
      <i className="fa fa-search"></i>
      <input onChange={()=>onSearch()} type='text' placeholder='ابحث'/>
      </div>
      
    </div>
  )
}
